select(2, ...).LoadData("APP_INFO","Global",[[return {version=41200,lastSync=1675272791,message={id=0,msg=""},news={{title="Dragonflight Update",content="In this post, we're going to dive into where we're at, what's coming soon, and where we're going with regards to supporting gold making in Dragonflight. I'll start things off here by apologizing for not being as active as I would have liked with communicating this information sooner. TSM was definitely not as ready as [...]",timestamp=1673451677,link="https://blog.tradeskillmaster.com/dragonflight-update/"},{title="TSM Addon 4.12 released!",content="Following the brief beta test, TSM Addon version 4.12 is now fully released for Dragonflight! Check out our previous blog post for a full recap of the changes you can look forward to: If you are running the TSM Desktop Application, you will be automatically updated. NOTE: It may take up to 12 hours for [...]",timestamp=1669676377,link="https://blog.tradeskillmaster.com/tsm-addon-4-12-released/"},{title="Announcing TSM 4.12 Beta Test!",content="As the launch of the Dragonflight expansion draws near, we're very happy to announce the beta test of the 4.12 addon update to TradeSkillMaster! If you’re a TSM Premium member you will shortly be receiving an email inviting you to participate, along with instructions on&nbsp;how to get started. Additional invites through our&nbsp;Beta sign-up page&nbsp;will be [...]",timestamp=1669395849,link="https://blog.tradeskillmaster.com/announcing-tsm-4-12-beta-test/"}}}]]) --<APP_INFO,Global,1675272791>
